import ImgBg from '../../images/bartender.png'

export const WelcomeScreenContainer = styled.div`
background: linear-gradient(to right, rgba(0,0,0,0), rgba(0,0,0,0)), url(${ImgBg});
height: 100vh;
background-position: center;
background-size: cover;
      
`
